import { Route, BrowserRouter as Router, Routes } from 'react-router-dom'

function Home() {
	return (
		<>
			<Router>
				<Routes>
					<Route path='/' element={<Home />} />
				</Routes>
			</Router>
		</>
	)
}

export default Home
